describe('Usages of the Discover command in a future paper', () => {
    beforeEach(() => {
        cy.visit('index.html');
        cy.get("body.application").click(10,10);
        cy.window().then((win) => {
            win.ggbApplet.setAxesVisible(false, false);
            win.ggbApplet.setGridVisible(false);
            var result = win.ggbApplet.evalCommandCAS("1+1");
            });
        cy.wait(2000);
    });

    afterEach(cy.setSaved);

    it("Brahmagupta theorem", () => {
        cy.window().then((win) => {
            ggbFile = "";
            win.ggbApplet.setBase64(ggbFile);
            });
        cy.wait(2000);
        cy.writeInAVInput("Discover(F)\n");
        cy.wait(200);
        cy.writeInAVInput("\n");
        cy.wait(200);
        cy.get(".RelationTool").should(($div) => {
           const text = $div.text();
           expect(text).to.include("AF = BF = EF");
           });
    });

    it("Thebault's theorem 1", () => {
        cy.window().then((win) => {
            ggbFile = "";
            win.ggbApplet.setBase64(ggbFile);
            });
        cy.wait(2000);
        cy.writeInAVInput("Discover(M)\n");
        cy.wait(200);
        cy.writeInAVInput("\n");
        cy.wait(200);
        cy.writeInAVInput("\n"); // attempt to work around slow response, FIXME
        cy.wait(1000);
        cy.get(".RelationTool").should(($div) => {
           const text = $div.text();
           expect(text).to.include("MN = MP = NO = OP");
           });
    });

    it("Thebault's theorem 2", () => {
        cy.window().then((win) => {
            ggbFile = "";
            win.ggbApplet.setBase64(ggbFile);
            });
        cy.wait(2000);
        cy.writeInAVInput("Discover(E)\n");
        cy.wait(200);
        cy.writeInAVInput("\n");
        cy.wait(200);
        cy.get(".RelationTool").should(($div) => {
           const text = $div.text();
           expect(text).to.include("BE = CE = CF = DF = EF");
           });
    });

});
